Fitness is not rocket science. It is not easy... but it's not nearly as complicated as some of you make it out to be..

‚Ä¢

Should I eat brown rice or white rice? Should I eat 6 meals a day? Fasted cardio or fed cardio? Wheat bread or Whole grain bread? etc.... 

‚Ä¢

I see and get questions like this often. Are there advantages within some of these? Absolutely.. but if you are not doing the most basic/foundational things on a consistent basis.. none of those things matter.

‚Ä¢

Are you working out regularly? Are you eating a good diet? Do you get decent sleep? How is your hydration?... Once you have all of those boxes checked THEN you can worry about white rice or brown rice. But until then, you are doing nothing but wasting time worrying about those little details

‚Ä¢

I honestly think that the business side of the nutrition/fitness industry is to blame for this mindset. We are constantly being told of the next best product that is the key for weight loss,muscle gain, etc... but you have to realize that these people are just trying to sell you their product. Again, I am not saying supplements are useless. But they should not be your main focus.

‚Ä¢

Take care of the basics first. Then worry about the details.

